import React from "react";
import Header from "../Children/Header";
import "../../assets/css/Login.css";

const Login = () => {
  return (
    <div>
      <Header />
      <section className="divLogin">
        <h2>
          Viddev/<span>Login</span>
        </h2>
      </section>
      <section className="loginContainer">
        <div className="login">
          <div className="loginTitle">
            <h2>Login</h2>
            <input id='inputLoginMail' type="mail" placeholder="Email" value='mail' />
            <input id="inputLoginPassword" type="password" placeholder="Password" value='password' />
          </div>
          <div className="btnLogin">
            <button id='BtnLogin' type="submit">Log in</button>
          </div>
        </div>
      </section>
    </div>


  );
};

let users = [
  ['User1', 'Name1', 'azerty1','username1@gmail.com'],
  ['User2', 'Name2', 'azerty2','username2@gmail.com'],
  ['User3', 'Name3', 'azerty3','username3@gmail.com']
]
let inputMail = document.getElementById('inputLoginMail');
let inputPassword = document.getElementById('inputLoginPassword');
let btnLogin = document.getElementById('btnLogin');

btnLogin.addEventListener('click', getValueInput);
function getValueInput(){
  document.getElementById('inputMail')
  document.getElementById('password')
}


export default Login;
